package day_9;

public class IMPLICIT_CASTING {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a=200;
double d=a;//implicit cast
System.out.println(d);
double d1=200.20;
int b=(int)d1;//explicit cant be converted

byte c=(byte)a;
System.out.println(c);


	}

}
